INSERT INTO `board` VALUES ('8', 'notice', 'PC https 우회 파이어폭스 이용', '&lt;p style=&quot;box-sizing: border-box; margin-top: 1em; margin-bottom: 1em; word-break: break-all; line-height: 21.6px; color: rgb(51, 51, 51); font-family: Arial, 돋움, Dotum, AppleGothic, sans-serif; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-weight: 700;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-family: &amp;quot;Arial Black&amp;quot;; font-size: 12pt; text-align: left; color: rgb(76, 76, 76);&quot;&gt;최근들어 정부에서 https 차단에 들어갔습니다&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 1em; margin-bottom: 1em; word-break: break-all; line-height: 21.6px; color: rgb(51, 51, 51); font-family: Arial, 돋움, Dotum, AppleGothic, sans-serif; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-weight: 700;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-family: &amp;quot;Arial Black&amp;quot;; font-size: 12pt; text-align: left; color: rgb(76, 76, 76);&quot;&gt;&lt;br style=&quot;box-sizing: border-box;&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 1em; margin-bottom: 1em; word-break: break-all; line-height: 21.6px; color: rgb(51, 51, 51); font-family: Arial, 돋움, Dotum, AppleGothic, sans-serif; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-weight: 700;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-family: &amp;quot;Arial Black&amp;quot;; font-size: 12pt; text-align: left; color: rgb(76, 76, 76);&quot;&gt;불법 사이트를 단속하는 것은 좋으나 중국처럼 인터넷 규제로 악용될 소지가 있어서 조심스럽네요&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 1em; margin-bottom: 1em; word-break: break-all; line-height: 21.6px; color: rgb(51, 51, 51); font-family: Arial, 돋움, Dotum, AppleGothic, s